INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (4, '(суббота) начался примерно 11 закончился около 14', 8, '2004-01-10 11:00:00', '2004-01-10 14:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (5, '(воскресенье) утром продолжался примерно 2 часа', 8, '2004-01-11 11:00:00', '2004-01-11 13:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (6, '(понедельник) утром продолжался примерно 2 часа (был у мануального т) затем был повторный с 17-18', 8, '2004-01-12 11:00:00', '2004-01-12 13:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (7, '(вторник) утром продолжался примерно 2 часа (был у мануального т)', 8, '2004-01-13 11:00:00', '2004-01-13 13:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (8, '(пятница) Я поехал в Питер в поезде в 2 часа ночи начался приступ окло 2 часов ночи, продолжался около двух часов далее весь день голова шумела', 8, '2004-01-16 02:00:00', '2004-01-16 04:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (9, '(суббота) начался примерно 10 30 закончился около 14 30', 8, '2004-01-17 10:30:00', '2004-01-17 13:30:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (10, '(воскресенье) начался примерно 10 закончился около 12 00', 8, '2004-01-18 10:00:00', '2004-01-18 12:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (11, 'новый приступ начался в поезде (я возвращался в Москву) около 17 в 22 в Москве в мед кабинете на вокзале мне измерили давлений 170/110 закончился в 23 после укола трольчатки', 8, '2004-01-18 17:00:00', '2004-01-18 23:40:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (12, '(вторник) приступ был слабый(был у мануального т)', 4, '2004-01-20 10:00:00', '2004-01-20 13:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (13, '(среда) приступ начался около 14 (в очереди к мануальному терапевту) закончился около 15 после укола баралгина', 6, '2004-01-21 14:00:00', '2004-01-21 15:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (14, '(четверг) приступ начался примерно 11 закончился около 14 к (мануальшику не пошел)', 6, '2004-01-22 11:00:00', '2004-01-22 14:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (15, '(пятница) приступ начался примерно 11 закончился около 14 к', 6, '2004-01-23 11:00:00', '2004-01-23 14:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (16, '(я поехал к мануальному терапевту) по дороге начался ещё один приступ мануальный терапевт сделал укол лидокаина в правую трапецию нащупав там место, которое более всего отдавало в голову, боль быстро прошла (примерно за 10 минут). Он поставил диагноз - миофасциальный болевой синдром', 6, '2004-01-23 15:00:00', '2004-01-23 15:45:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (17, '(понедельник) боль началась окло 10 30, прошла быстро, к 11 00, болевой синдром снимала зевота. Мне сделали укол кеналога (1/4 ампулы), псориаз весь прошел через два дня.', 6, '2004-01-26 10:30:00', '2004-01-26 11:15:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (18, '(среда) Утром делал зарядку с палками, около 12 30 начался приступ боли, боль прошла около 13 10 но беспокойство в голове осталось При повороте головы на лево на 90градусов, беспокойство уходило', 4, '2004-02-11 12:30:00', '2004-02-11 13:10:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (19, 'Шея немного затекла ночью, утром был сильный перепад температуры (похолодало примерно на 8-10 градусов) в с 10:30 до 12 случился приступ головной боли, не очень сильный.', 4, '2004-09-03 10:30:00', '2004-09-03 12:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (20, 'Утром сходил к мануальному терапевту, приступ боли случился по дороге (в этот день на улице тоже было холодно).', 4, '2004-09-06 13:00:00', '2004-09-06 13:45:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (21, 'Утром на работе был легкий приступ в 11 до 12.', 4, '2004-09-07 11:00:00', '2004-09-07 12:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (22, 'После тренировки пошел в душ, вышел на улицу (на улице сильно похолодало)по дороги домой случился очень сильный приступ головной боли. Приступ продолжался с 22 до 00. (доехал до дома на такси), до 23 лежал на кровати, потом пошел в душ, в душе приступ утих.(начал принимать сирдалут по 4мг 3 раза в день)', 10, '2004-09-17 22:00:00', '2004-09-18 00:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (23, 'Ночью случился приступ, начался в 5 Am прошел в душе в 6 Am', 4, '2004-09-18 05:00:00', '2004-09-18 06:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (24, 'Ночью в был ещё один приступ очень сильной головной боли, начался в 5 Am в душе в до 6 Am не прошел, выпил половину таблетки адельфана, резко упало давление (возможно из за приема сирдалута)в 7 уснул.', 10, '2004-09-19 05:00:00', '2004-09-19 07:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (25, 'Проснулся в 12, боль в голове осталась но слабее, к 14 боль стала невыносимой, Наташа сделала мне укол баралгина М 2мг, боль стала утихать через 15 мин, к 16 боль утихла. В 18 дискомфорт прошел совсем.', 8, '2004-09-19 12:00:00', '2004-09-19 14:25:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (26, 'был приступ головной боли, прошел через час', 6, '2004-09-23 05:00:00', '2004-09-23 06:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (27, 'в 10 30 начался приступ головной боли,я принял ванну - не помогло, в 11 45 пришел Сергей, помог сделать укол баралгина в вену, боль прошла через пол часа(легче стало через 5-10 минут), но дурно было весь день.', 8, '2004-09-26 10:30:00', '2004-09-26 12:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (28, 'в 11 45 начался приступ головной боли, я выпил 5мл баралгина, боли полностью прошли через 15 минут.', 4, '2004-09-29 11:45:00', '2004-09-29 12:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (29, 'В 5 часов утра был один слабый приступ,', 4, '2004-10-01 05:00:00', '2004-10-01 05:45:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (30, 'в 11 45 начался второй приступ головной боли (не сильный), к 12 30 боль усилилась, но была терпимая. в 13 боль прошла, осталось неприятное ощущение с права, в 18 я выпил 5мл баралгина, не подействовало, ощущение осталось до ночи.', 4, '2004-10-01 11:45:00', '2004-10-01 13:15:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (31, 'Был короткий приступ головной боли в 11 часов, прошел после приема баралгина.', 4, '2004-10-05 11:00:00', '2004-10-05 11:45:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (147, 'pain was bearable and I changed bed in less sunny room at Natali''s flat', 6, '2010-07-18 07:00:00', '2010-07-18 08:00:00', NULL, 1);
INSERT INTO report.attack (id, comments, max_pain_level, started, stopped, while_asleep, patient_id) VALUES (32, 'Сильно понервничал в парикмахерской (меня опять приняли не по записи и прождал лишних пол часа) Боль (средняя) в голове появилась на работе, я не стал дожидаться сильного приступа и выпил в 11:45 ампулу баралгина, боль прошла в 12:00.', 4, '2005-08-31 11:45:00', '2005-08-31 12:00:00', NULL, 1);
